import "./App.css";
import HomePage from './pages/HomePage'
import { BrowserRouter as Router, Route } from 'react-router-dom';
class App extends Component {
  render() {
    return (
      <Router>

      <div className="App">
        <HomePage/>
      </div>
      </Router>
    );
  }
}

export default App;
